import "./App.css";
import React, { Component, useEffect, useState } from "react";
import Home from "./components/regions/Home";
import Survey from "./components/regions/Survey";
import Results from "./components/regions/Results";
import { useDispatch } from "react-redux";
import HomeValidation from "./components/regions/Home/presentation";
import { getPosts } from "./actions/posts";

const App = () => {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getPosts());
  }, [dispatch]);

  return <HomeValidation />;
};

export default App;
